import React from "react";
import './WorldMap.css';
class WorldMap extends React.Component{
    constructor(props) {
        super(props);
        this.props = props;
    }

    render() {
        return (
            <div className={"map-container"}>
                <svg viewBox={"0 0 500 100"}>
                    <path d="m 88.80903,143.32547 c 0,0 -14.288579,6.3749 -14.288579,6.3749 0,0 -16.70665,-4.61631 -16.70665,-4.61631 0,0 -9.012798,-16.70665 -9.012798,-16.70665 0,0 24.84015,-3.95684 24.84015,-3.95684"/>
                </svg>
            </div>
        );
    }
}
export  default WorldMap;
